import React, { Component } from "react";

class TopStock extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isShow: true,
        };
    }


    toggleShow = () => {
        this.setState(state => ({ isShow: !state.isShow }));
    };

    render() {
        return (
            <div>
                <p> WHATTT {this.props[0].toString()} </p>
            </div>
        );
    }
}

export {
    TopStock
}
